import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

//Import the pages

import page1 from "./Components/page1"
import page2 from "./Components/page2"
import page3 from "./Components/page3"


function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/page1">
            <Page1 />
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
